import React, { useState } from 'react';
import GraphComponent, { FileUploader } from './components/GraphComponent';

export default function App() {
  const [graph, setValue] = useState(null);

  // Используйте функцию setGraph для установки нового значения состояния
  setValue("пиздец");

  return (
    <>
      {/* Передаем graph и функцию обновления в FileUploader */}
      <FileUploader caller={graph} />
      {/* Передаем graph в GraphComponent */}
      <GraphComponent />
    </>
  );
}
